import React, { Component } from 'react'


class Form extends Component {
    state = {
        inputValue: "Hello"
    }
    handleChange = (e) => {
        console.log(e.tagert.value)
        this.setState({ inputValue: e.target.value }) 
    }

    render() {
        return (
            <div className="Form">
                <form>
                    <input
                        onChange={(e) => this.handleChange(e)}
                        value={this.state.inputValue}
                    />
                </form>
            </div>
        );
    }
}

export default Form;
